import { Link, useLocation } from "react-router-dom";
import "../n.png"
import {FaUser, FaCalendar, FaClock, FaEnvelope, FaBook, FaUserFriends, FaInfoCircle}
    from "react-icons/fa";
import "./index.css"

function KanbasNavigation() {
    const links = ["Account", "Dashboard", "Courses", "Inbox", "Groups", "Calendar", "Help"];
    const N = <img src="../n.png" width={100} height={100}></img>
    const icons = [<FaUser/>, <FaClock/>, <FaBook/>, <FaEnvelope/>, <FaUserFriends/>, <FaCalendar/>,
    <FaInfoCircle/>]
    const { pathname } = useLocation();
    return (
        <nav className="list-group wd-pos-fixed" style={{ width: 125 }}>
            <div className="list-group-item list-group-item-danger">
                {N}
            </div>
            {links.map((link, index) => (
                <Link
                    key={index}
                    to={`/Kanbas/${link}`}
                    className={
                    `nav-link list-group-item list-group-item-danger ${pathname.includes(link) && "active"}`}>
                    <h2> {icons[index]} </h2> {link}
                </Link>
            ))}
        </nav>
    );
}
export default KanbasNavigation;
